  [],\n\t\"revision_timestamp\": \"2013-03-15T09:34:11.837098\",\n\t\"name\": \"accuracy-assessment-points-for-dinosaur-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This point file displays the 1543 accuracy
  assessment (AA) points visited in the summer of 2005 as part of the vegetation mapping
  project. The points were randomly selected, stratified by the map units used for
  vegetation mapping and further screened so as not to fall on inaccessible isolated
  mesa tops or vertical canyon walls. The coordinates were uploaded to Trimble and
  Garmin hand-held GPS receivers so that ecologists could navigate to them in the
  field. Some AA points fell on ecotones and two sets of data were recorded on the
  evenly-split sites. AA points that fell along polygon edges sometimes did not represent
  the entire polygon well and some AA points fell on small patches of vegetation that
  were different than the community in the larger polygon. Field photos are associated
  with each plot.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
